func TestBloom_Value(t *testing.T) {
	// Test case from: https://github.com/ethereum/eth-bloom/blob/master/tests/test_bloom_filter.py#L68
	bloom := eth.Bloom{}
	require.Equal(
		t,
		"",
		bloom.Value().String(),
	)
	bloom.AddBytes([]byte(`value 1`))
	bloom.AddBytes([]byte(`value 2`))

	b := big.NewInt(0)
	b.SetBytes(bloom.Value().Bytes())
	require.Equal(t, "", b.String())

	require.True(t, bloom.MatchesBytes([]byte(`value 2`)))
	require.False(t, bloom.MatchesBytes([]byte(`value 3`)))
}
